package com.nyd.order.entity.zzl;

public class HelibaoFlowLog {
		private String id;			//	private String bizType;			//接口类型	private String orderNumber;			//crm_order	private String custInfoId;			//cust_info	private java.util.Date createTime;			//创建时间	private String reqContent;			//请求参数	private String respContent;			//返回参数	private String remark;			//备注	public String getId() {	    return this.id;	}	public void setId(String id) {	    this.id=id;	}	public String getBizType() {	    return this.bizType;	}	public void setBizType(String bizType) {	    this.bizType=bizType;	}	public String getOrderNumber() {	    return this.orderNumber;	}	public void setOrderNumber(String orderNumber) {	    this.orderNumber=orderNumber;	}	public String getCustInfoId() {	    return this.custInfoId;	}	public void setCustInfoId(String custInfoId) {	    this.custInfoId=custInfoId;	}	public java.util.Date getCreateTime() {	    return this.createTime;	}	public void setCreateTime(java.util.Date createTime) {	    this.createTime=createTime;	}	public String getReqContent() {	    return this.reqContent;	}	public void setReqContent(String reqContent) {	    this.reqContent=reqContent;	}	public String getRespContent() {	    return this.respContent;	}	public void setRespContent(String respContent) {	    this.respContent=respContent;	}	public String getRemark() {	    return this.remark;	}	public void setRemark(String remark) {	    this.remark=remark;	}
}
